import { Table, Tag, Space } from "antd";

import { Tabs } from 'antd';

const { TabPane } = Tabs;

function callback(key) {
  console.log(key);
}


const columns = [
  {
    title: "Ma Khach hang",
    dataIndex: "MaKH",
    key: "MaKH",
    render: (text) => <a>{text}</a>,
  },
  {
    title: "Ten khach hang",
    dataIndex: "TenKH",
    key: "TenKH",
  },
  {
    title: "Email khach hang",
    dataIndex: "email",
    key: "email",
  },
  {
    title: "SDT",
    key: "Sdt",
    dataIndex: "Sdt",

  },
];

const data = [
  {
    MaKH: "1",
    TenKH: "Tran Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "2",
    TenKH: "Nguyen Uy",
    email: "asdas",
    Sdt: "123213",
  },
  {
    MaKH: "3",
    TenKH: "Ho Uy",
    email: "asdas",
    Sdt: "123213",
  },
];

function DsKhachHang() {
  return (
    <div>
      <Table columns={columns} dataSource={data} />
    </div>
  );
}

export default DsKhachHang;
